import React from 'react'
import "./Navbar.css";
function Navbar() {
    return (
        <div className="Navbar">
            <a href="/">Home</a>
            <a href="/"> Login</a>
            <a href="/" >Register</a>
        </div>
    )
}

export default Navbar
